package net.ibizsys.central.cloud.saas.ebsx.user.plugin.groovy.dataentity.util;

import groovy.transform.CompileStatic
import net.ibizsys.central.dataentity.IDataEntityRuntime
import net.ibizsys.central.dataentity.util.DENotifySettingUtilRuntime
import net.ibizsys.model.dataentity.defield.IPSDEField
import net.ibizsys.runtime.util.IEntity

@CompileStatic
public class NotifySettingUtilRuntimeEx extends DENotifySettingUtilRuntime {
    private List<String> systemList = null;
    private boolean excludeMode = false;

    private String PARAM_EXCLUDEMODE = "excludemode";
    private String PARAM_SYSTEMLIST = "systemlist";
    private String PARAM_CONFIGFOLDER = "ignoretodonotify";

    private IPSDEField settingOwnerTypePSDEField = null;

    protected void prepareSettingDataEntityRuntime() throws Exception {
        IDataEntityRuntime settingDataEntityRuntime = this.getDataEntityRuntime();
        this.setSettingDataEntityRuntime(settingDataEntityRuntime);
        this.excludeMode = settingDataEntityRuntime.getSystemRuntime().getSystemRuntimeSetting().getParam(this.getConfigFolder() + "." + PARAM_EXCLUDEMODE, false);
        this.systemList = (List<String>)settingDataEntityRuntime.getSystemRuntime().getSystemRuntimeSetting().getParam(this.getConfigFolder() + "." + PARAM_SYSTEMLIST);
    }

    @Override
    protected Map<String, Integer> onGetSettings(IEntity iEntity, String strNotifyTag, int nMsgType, Set<String> personIdSet) throws Throwable {
        //存在问题，若为系统内部定时触发可能会计算到当前系统标识
        String curSystemId = this.getSystemRuntime().getUser()getSessionParam("srfsystemid");
        Map<String, Integer> settings = new LinkedHashMap<String, Integer>();
        for(String strPersonId : personIdSet) {
            settings.put(strPersonId, nMsgType);
        }
        if(excludeMode){
            if(systemList == null || !systemList.contains(curSystemId)){
                settings.clear();
            }
        }else {
            if(systemList != null  && systemList.contains(curSystemId)){
                settings.clear();
            }
        }
        return settings;
    }

    protected String getConfigFolder() {
        return PARAM_CONFIGFOLDER;
    }
}
